import React, { Component } from "react";
import { Box } from "grommet";

const ErrorPage = props => (
  <Box
    background={"#4A4C4E"}
    a11yTitle={"stuff"}
    align={"center"}
    allignContent={"center"}
    alignSelf={"strech"}
    height={"full"}
    round={"small"}
  >
    <h2>We are unable to find this page.</h2>
  </Box>
);

export default ErrorPage;
